measurements.description:
One fairly flat flower on one 4-cm inflorescence; 

 sepals lanceolate, tips reflexed, lavender-pink, darker medial stripes;
 petals ovate, lancolate, lavender-pink, darker veins; 
 lip tubular, ruffled edge, white overlaid dark lavender proximally, yellow keel area, keels darker yellow, lavender picotee; 

 column dark lavender, anther cap cream;
 substance firm; texture crystalline.
